        static void PrintToConsole(int[,] field, Dictionary<int, ConsoleColor> colors)
        {
            ConsoleColor previous = Console.BackgroundColor;

            for (int i = 0; i < field.GetLength(0); i++)
            {
                for (int j = 0; j < field.GetLength(1); j++)
